import React from 'react';
import {
    Nav,
    NavLink,
    NavMenu,
    NavBtn,
    NavBtnLink,
    NavBtnContain,
    NavTitle
  } from './navbarstyle';

const Navigation = () => {
    return (
        <>
          <Nav>
            <NavTitle><h1>WeatherWatch</h1></NavTitle>
            <NavBtnContain>
              <NavBtn>
                <NavBtnLink to='/'> &nbsp;Login</NavBtnLink>
              </NavBtn>
              <NavBtn>
                <NavBtnLink to='/SignUp'>Sign Up</NavBtnLink>
              </NavBtn>
            </NavBtnContain>
          </Nav>
        </>
    )
}

export default Navigation;
